import React from 'react';
import { Image } from 'react-bootstrap';

class Course extends React.Component{
    constructor(){
        super()
    }

    render(){
        return(
            <div className="container">
                <h1>Course</h1>
                <Image src={require('.../public/asset/java_1.png')} rounded/>
            </div>
        )
    }
}
export default Course;
